/* Procedure structure for procedure `insert_year_dates` */

/*!50003 DROP PROCEDURE IF EXISTS  `insert_year_dates` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_year_dates`()
    MODIFIES SQL DATA
BEGIN 
	SET @start_date = (SELECT MAKEDATE(EXTRACT(YEAR FROM MAKEDATE(EXTRACT(YEAR FROM DATE_ADD(CURDATE(), INTERVAL 1 YEAR) ),1)),1));
    SET @t_current = @start_date; 
    SET @t_end = DATE_ADD(@start_date, INTERVAL 1 YEAR); 
    WHILE(@t_current< @t_end) DO 
        INSERT INTO sys_activedate(datedesc) VALUES (@t_current); 
        SET @t_current = DATE_ADD(@t_current, INTERVAL 1 DAY); 
    END WHILE; 
END */$$
DELIMITER ;

